shader_model.global:
vec2 align_shapes_uv(vec2 uv, float offset, float seed) {
	float angle = rand(vec2(seed, floor(uv.x/(1.0+offset))));
	uv.x = mod(uv.x, 1.0+offset);
	uv = clamp(uv, vec2(0.0), vec2(1.0))-vec2(0.5);
	float ca = cos(angle);
	float sa = sin(angle);
	mat2 rot = mat2(vec2(ca, sa), vec2(-sa, ca));
	return rot*uv+vec2(0.5);
}

float filter_angle(vec3 input_normal, vec3 ref_vector, float max_angle, float smoothness) {
	return 1.0-clamp((cos(max_angle*0.01745329251)-dot(normalize(input_normal), normalize(ref_vector)))/smoothness, 0.0, 1.0);
}

vec3 tex3d_rotate(vec3 p, vec3 a) {
	vec3 rv;
	float c;
	float s;
	c = cos(a.x);
	s = sin(a.x);
	rv.x = p.x;
	rv.y = p.y*c+p.z*s;
	rv.z = -p.y*s+p.z*c;
	c = cos(a.y);
	s = sin(a.y);
	p.x = rv.x*c+rv.z*s;
	p.y = rv.y;
	p.z = -rv.x*s+rv.z*c;
	c = cos(a.z);
	s = sin(a.z);
	rv.x = p.x*c+p.y*s;
	rv.y = -p.x*s+p.y*c;
	rv.z = p.z;
	return rv;
}

shader_model.instance:
vec4 $(name)_fct(vec2 uv) {
	vec3 e = vec3(1.0/$size, -1.0/$size, 0);
	vec4 rv = $in(uv);
	rv += $in(uv+e.xy);
	rv += $in(uv-e.xy);
	rv += $in(uv+e.xx);
	rv += $in(uv-e.xx);
	rv += $in(uv+e.xz);
	rv += $in(uv-e.xz);
	rv += $in(uv+e.zx);
	rv += $in(uv-e.zx);
	return rv/9.0;
}

vec2 get_top_direction(vec2 uv, vec3 d) {
	vec2 epsilon = vec2(0.01, 0.0);
	vec2 mult = vec2(1.0);
	vec3 v1 = normalize(mesh_aabb_size*(texture(mesh_inv_uv_tex, uv+epsilon)-texture(mesh_inv_uv_tex, uv-epsilon)).xyz);
	if (dot(v1, d) < 0.0) {
		v1 = -v1;
		mult.x = -1.0;
	}
	vec3 v2 = normalize(mesh_aabb_size*(texture(mesh_inv_uv_tex, uv+epsilon.yx)-texture(mesh_inv_uv_tex, uv-epsilon.yx)).xyz);
	float best_dot = dot(v2, d);
	if (best_dot < 0.0) {
		v2 = -v2;
		mult.y = -1.0;
		best_dot = -best_dot;
	}
	float best_x = 0.0;
	float x;
	for (x = 0.0; x <= 1.0; x += 0.1) {
		float new_dot = dot(normalize(v1*x+v2*sqrt(1.0-x*x)), d);
		if (new_dot > best_dot) {
			best_x = x;
			best_dot = new_dot;
		}
	}
	return vec2(best_x, sqrt(1.0-best_x*best_x))*mult;
}

