shader_model.instance:
vec4 triplanar_$(name)(vec2 uv, float k) {
	vec3 p = mesh_aabb_position+texture(mesh_inv_uv_tex, uv).xyz*mesh_aabb_size;
	vec3 n = 2.0*(texture(mesh_normal_tex, uv).xyz-vec3(0.5));

	// project+fetch
    vec4 x = $in(p.zy);
    vec4 y = $in(p.zx);
    vec4 z = $in(p.xy);

    // blend factors
    vec3 w = pow(abs(n), vec3(k));
    // blend and return
    return (x*w.x + y*w.y + z*w.z) / (w.x + w.y + w.z);
}

